import React, { useState,useEffect ,useRef} from "react";
import { Post } from "../../componens/post/post";
import "./home.scss";


export const Home = () => {
    const [page, setPage] = useState(1);
    const [posts , setPosts] = useState([
      <Post  userName={"Eldad"} shopName={"Tedooo"} text={"My cat and my dog are the most beautiful in the pictures : )"} imgSrc={"data:image/jpeg;base64,"} imgSrcTow={"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTMWJqP3gln_06nqC_HE2Ec00WzPHhlGcP_SQ&usqp=CAU"}></Post>,
      <Post  userName={"Yosi"} shopName={"Tedooo"} text={"The view from my house in the morning (9:00)."}  imgSrc={"data:image/jpeg;base64,"} imgSrcTow={""}></Post>,
      <Post  userName={"Doron"} shopName={"Tedooo"} text={"The lemons in my yard."}  imgSrc={"data:image/jpeg;base64,"} imgSrcTow={""}></Post>,
      <Post  userName={"Dor"} shopName={"Tedooo"} text={"I went on a trip this weekend and took a lot of beautiful pictures from the north."} imgSrc={"data:image/jpeg;base64,"} imgSrcTow={"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQFQV_9DCtruN0IM0XkbjZDfqYejBoUeMbMOw&usqp=CAU"}></Post>,
      <Post  userName={"Noam"} shopName={"Tedooo"} text={"My sister does artwork, feel free to send her a private message."}  imgSrc={"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTlkwbCLcZ36c0y1yDQWiOb7s9p-7HjC0ULDg&usqp=CAU"} imgSrcTow={"data:image/jpeg;base64,"}></Post>,
      <Post  userName={"Shay"} shopName={"Tedooo"} text={"Getting ready for summer "}  imgSrc={"data:image/jpeg;base64,"} imgSrcTow={""}></Post>
    ]);
    const [isLoading, setIsLoading] = useState(false);
    const observer = useRef<IntersectionObserver>();
  
    useEffect(() => {
      const loadPosts = async () => {
        setIsLoading(true);
        const newPosts = posts
        setPosts((prevPosts) => [...prevPosts, ...newPosts]);
        setIsLoading(false);
      };
      loadPosts();
    }, [page]);
  
    useEffect(() => {
      observer.current = new IntersectionObserver((entries) => {
        const first = entries[0];
        if (first.isIntersecting && !isLoading) {
          setPage((prevPage) => prevPage + 1);
        }
      });
    }, [isLoading]);
  
    useEffect(() => {
      const element = document.querySelector('#end-of-posts');
      if (!element) return; 
      if (observer.current) {
        observer.current.observe(element);
        return () => {
          observer.current?.disconnect();
        };
      }
    }, []);


 return (
  <>
  {posts.map((post, index) => (
    <div key={index}>{post}</div>
  ))}
  <div id="end-of-posts"></div>
  {isLoading && <div>Loading...</div>}
 </>

    
 );
};
